✅ PASSED: H.R. 2966 - American Entrepreneurs First Act

My common-sense legislation ensures SBA funds go to American citizens, not to individuals or businesses with foreign or undocumented ownership.

@HouseGOP is standing up for American small businesses and protecting taxpayer dollars from waste, fraud, and abuse.

I know Democrats in Congress don’t read very well, and I know these same Democrats lied about how Georgia voter registration changes were “Jim Crow 2.0” and would discriminate against minorities (proven to be utterly false), so it should come as no surprise that these “geniuses” aren’t aware of the following language in the SAVE Act to accommodate women and name changes:

“(B) PROCESS IN CASE OF CERTAIN DISCREPANCIES IN DOCUMENTATION.—Subject to any relevant guidance adopted by the Election Assistance Commission, each State shall establish a process under which an applicant can provide such additional documentation to the appropriate election official of the State as may be necessary to establish that the applicant is a citizen of the United States in the event of a discrepancy with respect to the applicant’s documentary proof of United States citizenship.”

@RepChipRoy
